import React, { useEffect, useState } from 'react';
import './App.css';
import { BrowserRouter, Route, Routes, } from 'react-router-dom';
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import Home from './components/view/Home';
import Admin from './components/view/Admin';
import EmailVerify from './components/emailVerify/EmailVerify';
import axios from 'axios';





function App() {

  const [user, setUser] = useState([])

  const getLoginUser = async () => {
    try {
      const response = await axios.get('http://localhost:5001/api/logedin/user', { withCredentials: true })
      setUser(response.data)
    } catch (error) {
      console.log(error)
      window.location.href = 'http://localhost:3000/home';
    }
  }

  useEffect(() => {
    getLoginUser()
  }, [])


  console.log("Loged in user detais:",user)
  return (
    <>

      <BrowserRouter>
        <Routes>

          <Route path='/' element={<Login />} />
          <Route path='/register' element={<Register />} />
          <Route path='/user/verify/:token' element={<EmailVerify />} />

          <Route path='/home' element={<Home />} />
          <Route path='/admin' element={<Admin />} />



        </Routes>
      </BrowserRouter>

    </>
  );
}

export default App;
